msg.payload.lat = msg.payload.latitude;
msg.payload.lon = msg.payload.longitude;
msg.payload.name = msg.payload.id;
msg.payload.icon = "globe";
if( msg.payload.mag > 4 ) {
    msg.payload.iconColor = "red";
} else {
    msg.payload.iconColor = "orange";
}

if( msg.payload.mag > 5 ) {
    msg.alert = true;
} 

delete msg.payload.latitude;
delete msg.payload.longitude;
delete msg.payload.type;
return msg;

// splits giant string of Earthquake csv data at each new line
quakes = msg.payload.split(/\r\n|\r|\n/);
// Skip the first line - which contains column headers
// The array of json objects could be
// Quake = {  "time",
//            "latitude",
//            "longitude",
//            "depth",
//            "mag",
//            "magType",
//            "nst",
//            "gap",
//            "dmin",
//            "rms",
//            "net",
//            "id",
//            "updated",
//            "place",
//            "type",
//            "horizontalError",
//            "depthError",
//            "magError",
//            "magNst",
//            "status",
//            "locationSource",
//            "magSource"
//        };
// eg:
// "2018-09-16T22:04:11.440Z,36.8370018,-121.5719986,5.99,2.56,md,50,36,0.03809,0.11,nc,nc73085075,2018-09-16T22:25:02.684Z,"3km WSW of San Juan Bautista, CA",earthquake,0.19,0.4,0.17,32,automatic,nc,nc"
// ["2018-09-16T22:04:11.440Z","36.8370018","-121.5719986","5.99","2.56","md","50","36","0.03809","0.11","nc","nc73085075","2018-09-16T22:25:02.684Z","\"3km WSW of San Juan Bautista"," CA\"","earthquake","0.19","0.4","0.17","32","automatic","nc","nc"]

var QuakeArray = [];
var ThisQuake = {};
// Start at 1 because 0 has the column headers
for( var i = 1; i < quakes.length; i++ ) {
    // Split each line into a json object that describes an earthquake
    columns = quakes[i].split(',');

    // We only care about "place" and "mag" for our little table
    // place is column[13]
    // mag is column[4]
    // Build a json object

    // The Location string will often contain quoted "South of Tonga"
    // It looks strange in the dashboard table so remove the "" 
    if( typeof( columns[13] ) != 'undefined') {
        columns[13] = columns[13].replace(/"/g, '');
        // Build a json object
        ThisQuake = {"Location":columns[13],"Mag":columns[4],"lat":columns[1],"lng":columns[2],"time":columns[0]};
        // Add this Quake to an array of Quakes from the 2.5 Day CSV
        QuakeArray.push( ThisQuake );
    }
}
msg.payload = QuakeArray;
return msg;

msg.payload = { command : { zoom:8, 
                            "lat":msg.payload.lat,
                            "lon":msg.payload.lng,
                            autopan:true }
};
return msg;
